import React, { useState ,useEffect} from 'react';
import { Text,StyleSheet, View,ScrollView ,Image,ImageBackground,Picker,Button} from 'react-native';
import Icons from './Icons';
const Entete =props => {
  const [selectedValue, setSelectedValue] = useState("java");
  this.state = {
    stations: [],
  }
  useEffect(() => {
    // Met à jour le titre du document via l’API du navigateur
    
    console.log('render!');
  });
 return (            
  <ImageBackground source={require('../assets/Arriere.png')} style={styles.backgroundStyle} >
    <ScrollView >  
      <Text style={styles.itemText1}> Bienvenue Ahmed</Text>
      <View style={styles.container}>
         <Picker
        selectedValue={selectedValue}
        style={{ height: 40, width: 180 }}
        onValueChange={(itemValue, itemIndex) => setSelectedValue(itemValue)}
         >
             <Picker.Item label="Java" value="java" />
             <Picker.Item label="JavaScript" value="js" />
      </Picker>
      <Image source={require('../assets/position.png')}    style={{ height: 45}}/> 
      </View>
      <Text style={styles.itemText2}>Lundi 12 Mars 2021</Text>  
    
      <View style={styles.itemView1}>
           <Image source={require('../assets/vent7.png')} style={styles.ba1}/>  
           <Image source={require('../assets/vent5.png')} style={styles.ba1}/> 
           <Image source={require('../assets/vent6.png')} style={styles.ba1}/>  
      </View>   
      <Icons/>
     
    </ScrollView >  
  </ImageBackground>
  
        );
      };
     
    // create style to component
    const styles = StyleSheet.create({
      backgroundStyle: {
        flex: 1,
        width: 400,
        height: 300,
        resizeMode: 'cover',
      },

      itemText1: {
        color: '#FFFFFF',
        marginTop: 20,
        marginLeft: 40,
        fontSize:20
      },
      itemText2: {
        color: '#FFFFFF',
        marginBottom:40,
        marginLeft: 250,
        marginTop:10,
        fontSize:10,
        borderRadius: 50,
      },
      itemView1: {
        flexDirection: 'row',
        marginLeft:30
      },
      ba1:{
        marginRight:30
      },
      
      container: {
        flex: 1,
        backgroundColor: '#FFFFFF',
        borderRadius: 50,
        width:150,
        height:40,
        marginLeft:40,
        marginTop:10,
        flexDirection: 'row',
      }
      });
    //Export to component so we can use it elsewhere in our project
    export default  Entete ;
